function approximateFunction(reDomain, imDomain, resolution, values) {
  return function({ re, im }) {
    const i = Math.round((re - reDomain[0]) / resolution);
    const j = Math.round((im - imDomain[0]) / resolution);
    const value = values[i][j];

    return { re: value[0], im: value[1] };
  };
}

